import React from 'react';
import '../../css/home/GameCardList.css';

function GameCardList() {
    return (
        <div className="games-list-cyio py-5 bg-light">
            <div className="container">
                <div className="row" id='card-root'>
                </div>
            </div>
        </div>
    );
}

export default GameCardList;
